import React from "react";
import myImage from '../assets/image 1.png';
import Man from '../assets/image (1).png';
import Wimg from '../assets/Group 89073.png'
import './Header.css'
function Header() {
  return (
    <div className="Par">
      <div className="header"> 
      <img className="ImgLogo" src={myImage} alt="My Image" />
      <button className="logoutbtn">LogOut</button>
      </div>
      <hr/>

      <div className="Agent">
        <img className="manimg" src={Man} alt="" />
        <p className="Con">satendra <br/> +91-8006245734</p>
      </div>
      <div className="Warn">
        <img className="Wimg" src={Wimg} alt="" />
        <p className="Wcon">1 बसों के बारे में सूचना नहीं दी गई है</p>
      </div>
    </div>
  );
}

export default Header;
